function getQueryStringValue (key) {
	return decodeURIComponent(window.location.search.replace(new RegExp("^(?:.*[&\\?]" + encodeURIComponent(key).replace(/[\.\+\*]/g, "\\$&") + "(?:\\=([^&]*))?)?.*$", "i"), "$1"));
}

// borrowed from https://gist.github.com/niyazpk/f8ac616f181f6042d1e0
function updateUrlParameter (uri, key, value) {
	// remove the hash part before operating on the uri
	var
		i = uri.indexOf('#'),
		hash = i === -1 ? '' : uri.substr(i)
		;

	uri = i === -1 ? uri : uri.substr(0, i);

	var
		re = new RegExp("([?&])" + key + "=.*?(&|$)", "i"),
		separator = uri.indexOf('?') !== -1 ? "&" : "?"
		;

	if (!value) {
		// remove key-value pair if value is empty
		uri = uri.replace(new RegExp("([?&]?)" + key + "=[^&]*", "i"), '');

		if (uri.slice(-1) === '?') {
			uri = uri.slice(0, -1);
		}
		// replace first occurrence of & by ? if no ? is present

		if (uri.indexOf('?') === -1) {
			uri = uri.replace(/&/, '?');
		}

	} else if (uri.match(re)) {
		uri = uri.replace(re, '$1' + key + "=" + value + '$2');
	} else {
		uri = uri + separator + key + "=" + value;
	}
	return uri + hash;
}

var
	lang = getQueryStringValue('lang') || 'en',
	stretching = getQueryStringValue('stretching') || 'auto'
;

$('select[name=lang]').on('change', function () {
	window.location.href = updateUrlParameter(window.location.href, 'lang', $(this).val());
}).val(lang);

$('select[name=stretching]').on('change', function () {
	window.location.href = updateUrlParameter(window.location.href, 'stretching', $(this).val());

}).val(stretching);

$('select[name=sources]').on('change', function () {
	var
		_this = $(this),
		media = _this.closest('.players').find('.media-wrapper').find('.mejs__container').attr('id'),
		player = mejs.players[media]
	;

	player.setSrc(_this.val().replace('&amp;', '&'));
	player.load();

	var renderer = $('#' + player.media.id + '-rendername');
	renderer.find('.src').html('<a href="' + _this.val() + '" target="_blank">' + _this.val() + '</a>')
		.end()
		.find('.renderer').html(player.media.rendererName)
		.end()
		.find('.error').html('')
	;

});

// These media types cannot play at all on iOS, so disabling them
if (mejs.Features.isiOS) {
	$('select').find('option[value^="rtmp"]').prop('disabled', true)
	.end()
	.find('option[value$="webm"]').prop('disabled', true)
	.end()
	.find('option[value$=".mpd"]').prop('disabled', true)
	.end()
	.find('option[value$=".ogg"]').prop('disabled', true)
	.end()
	.find('option[value*=".flv"]').prop('disabled', true);
}

$(document).ready(function () {

	mejs.i18n.language(lang);

	$('video, audio').mediaelementplayer({
		stretching: stretching,
		pluginPath: '../build/',
		success: function (media) {
			$(media).closest('.media-wrapper').find('.mejs__container').attr('lang', mejs.i18n.language());

			var renderer = $('#' + media.id + '-rendername');

			media.addEventListener('loadedmetadata', function (e) {
				var src = media.originalNode.getAttribute('src').replace('&amp;', '&');
				if (src !== null && src !== undefined) {
					renderer.find('.src').html('<a href="' + src + '" target="_blank">' + src + '</a>')
					.end()
					.find('.renderer').html(media.rendererName)
					.end()
					.find('.error').html('')
					;
				}
			}, false);

			media.addEventListener('error', function (e) {
				renderer.find('.error').html('<strong>Error</strong>: ' + e.message);
			}, false);
		}
	});
});

  jQuery(function($) {
    var supportsAudio = !!document.createElement('audio').canPlayType;
    if(supportsAudio) {
      var index = 0,
      playing = false;
      mediaPath = '..',
      extension = '',
      // tracks = [
      //   {"name":"Nummer A","file":"1"},
      //   {"name":"Nummer B","file":"2"},
      //   {"name":"Nummer C","file":"3"},
      //   {"name":"Nummer D","file":"4"},
      //   {"name":"Nummer E","file":"5"},
      //   {"name":"Nummer F","file":"6"}
      // ],
      trackCount = tracks.length,
      title = $('.audio-player-title'),
      audio = $('#audio-player').bind('play', function() {
        playing = true;
        $('html').addClass('audio-playing');
        // if($('html').hasClass('video-playing')) { alert('double play!') }
      }).bind('pause', function() {
        playing = false;
        $('html').removeClass('audio-playing');
      }).bind('ended', function() {
        if((index + 1) < trackCount) {
          index++;
          loadTrack(index);
          audio.play();
        } else {
          audio.pause();
          index = 0;
          loadTrack(index);
        }
      }).get(0),
      li = $('.audio-tracklist ul li').click(function() {
        var id = parseInt($(this).index());
        if(id !== index) {
          playTrack(id);
        }
      }),
      loadTrack = function(id) {
        $('.selected-track').removeClass('selected-track');
        $('.audio-tracklist ul li:eq(' + id + ')').addClass('selected-track');
        title.text(tracks[id].name);
        index = id;
        audio.src = mediaPath + tracks[id].file;
      },
      playTrack = function(id) {
        loadTrack(id);
        audio.play();
      };

      extension = audio.canPlayType('audio/mpeg') ? '.mp3' : audio.canPlayType('audio/ogg') ? '.ogg' : '';

      loadTrack(index);
    }

    $('#useLegend').click(function(e) {
      e.preventDefault();
      $('#use').slideToggle(300, function() {
        $('#useSpanSpan').text(($('#use').css('display') == 'none' ? 'show' : 'hide'));
      });
    });
  });

// OPEN PORTFOLIO
function openPortfolio(windowname) {
  var windowclass = '.' + windowname;
  if (!$('html').hasClass('portfolio-open')) {
    $('html').addClass('portfolio-open');
    $('.portfolio-nav').hide().delay(300).fadeIn(300);
    $('.portfolio > ul').show();
    $('.tab-link').addClass('first-open');
    $('.portfolio-nav-a' + windowclass).trigger('click');
  }
};

$(document).ready(function () {

  // NAVIGATION WITHIN PORTFOLIO
  $('.portfolio-nav-a').on('click', function(event) {
    $('.portfolio-wrapper').animate({ scrollTop: 0}, 300, 'swing');
    $('.portfolio-nav').find('.active-window').removeClass('active-window');
    $(this).addClass('active-window');
    if ($(this).hasClass('videos')) { $('.tab-link.videos').trigger('click'); }
    if ($(this).hasClass('muziek')) { $('.tab-link.muziek').trigger('click'); }
    if ($(this).hasClass('voice-overs')) { $('.tab-link.voice-overs').trigger('click'); }
  });

  // TAB SWITCHING
  $('.portfolio ul').on('click', 'li > a.tab-link', function(event) {
    if (!$(this).hasClass('first-open')) {
      event.preventDefault();
      $('.portfolio ul').find('.is-open').removeClass('is-open').fadeOut(300);
      $(this).next().toggleClass('is-open').delay(300).fadeIn(300);
      $('.portfolio ul').find('.active-window').removeClass('active-window');
      $(this).addClass('active-window');
    } else {
      event.preventDefault();
      $('.portfolio ul').find('.first-open').removeClass('first-open');
      $('.portfolio ul').find('.is-open').removeClass('is-open').hide();
      $(this).next().toggleClass('is-open').delay(300).fadeIn(300);
      $('.portfolio ul').find('.active-window').removeClass('active-window');
      $(this).addClass('active-window');
    }
  });

  // CLOSE PORTFOLIO
  $('.close-portfolio').on('click', function(event) {
    // $('.portfolio ul').find('.active-window').
    $('html').removeClass('portfolio-open');
    $('html').addClass('portfolio-closing');
    setTimeout(function(){ $('html').removeClass('portfolio-closing'); }, 300);
    $('.portfolio-wrapper').animate({ scrollTop: 0 }, 300);
    $('.portfolio-nav, .portfolio > ul').fadeOut(200);
  });
});
